INSERT INTO `news_info` VALUES ('20170217152254474', '总理力推双创 ', '新浪', '但凡社会经历大的变革和转型时期，通常都会有一件“自下而上”的重要事情，影响甚至决定着变革和转型的成功与否，就像上世纪20年代开始的中国革命、上世纪70年代末开始的中国改革。那么，当前正在进行的中国经济转型，又有哪件至关重要的事情呢？我以为，它就是“大众创业，万众创新”。\n\n　　当然，这并不是说“自上而下”就不重要。但很多时候，“自下而上”往往能提供或创造更鲜活的动力。以“双创”为例，它显然能够担当起中国经济中长期增长、战略性新兴产业成长、供给侧结构性改革纵深推进乃至重塑主流价值的重任。这是一股不可或缺的源头活水。', '2017-02-17 15:22:54', '2017-02-17 15:22:54', '0', '20170217111105240', null, '2017-02-17', '1');
INSERT INTO `news_info` VALUES ('20170217152254475', '总理力推双创 ', '新浪', '但凡社会经历大的变革和转型时期，通常都会有一件“自下而上”的重要事情，影响甚至决定着变革和转型的成功与否，就像上世纪20年代开始的中国革命、上世纪70年代末开始的中国改革。那么，当前正在进行的中国经济转型，又有哪件至关重要的事情呢？我以为，它就是“大众创业，万众创新”。\r\n\r\n　　当然，这并不是说“自上而下”就不重要。但很多时候，“自下而上”往往能提供或创造更鲜活的动力。以“双创”为例，它显然能够担当起中国经济中长期增长、战略性新兴产业成长、供给侧结构性改革纵深推进乃至重塑主流价值的重任。这是一股不可或缺的源头活水。', '2017-02-17 15:22:54', '2017-03-17 10:33:53', '0', '20170217111105240', , '2017-02-17', '1');
INSERT INTO `news_info` VALUES ('20170217152324819', '金正男遇害对中朝关系产生负面影响？', '新浪', '应冈比亚共和国总统阿达马·巴罗邀请，全国政协副主席马培华将作为国家主席习近平特使，赴冈比亚首都班珠尔出席于2月18日举行的巴罗总统就职仪式暨冈比亚独立日庆典。\n\n　　中冈2016年3月复交以来，两国各领域合作全面推进。中冈复交顺应历史潮流，符合两国和两国人民的根本利益。中方赞赏巴罗领导的冈比亚新政府坚持一个中国政策，愿以落实中非合作论坛约翰内斯堡峰会成果为契机，同冈方共同努力，推动中冈全面友好合作深入发展，造福两国人民。', '2017-02-17 15:23:24', '2017-02-17 15:23:24', '0', '20170217143018997', null, '2017-02-17', '1');
