INSERT INTO `news_info` VALUES ('20170312101408788', '习近平等出席全国两会少数民族代表委员茶话会', '新浪', '3月11日晚，中共中央统战部、全国人大民族委员会、国家民族事务委员会、全国政协民族和宗教委员会在北京人民大会堂举行茶话会，党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等与出席十二届全国人大五次会议和全国政协十二届五次会议的少数民族代表委员们欢聚一堂，共庆全国两会胜利召开，共祝伟大祖国繁荣昌盛，共话中华民族美好未来。新华社记者 李学仁 摄\r\n\r\n　　新华社北京3月11日电 中华民族一家亲，同心共筑中国梦。中共中央统战部、全国人大民族委员会、国家民族事务委员会、全国政协民族和宗教委员会11日晚在北京人民大会堂举行茶话会，党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等与出席十二届全国人大五次会议和全国政协十二届五次会议的少数民族代表委员们欢聚一堂，共庆全国两会胜利召开，共祝伟大祖国繁荣昌盛，共话中华民族美好未来。\r\n\r\n　　党的十八大以来，以习近平同志为核心的党中央高度重视民族工作，高度关注少数民族和民族地区发展。习近平总书记多次深入民族地区考察调研，体察少数民族群众冷暖，对民族工作作出全面部署。在党中央坚强领导下，民族地区抓住机遇、深化改革、推动创新、应对挑战，改革发展迈出新步伐，取得新成就。\r\n\r\n　　人民大会堂宴会厅灯火辉煌，欢声笑语，洋溢着喜庆热烈的气氛。19时45分，在欢快的乐曲声中，习近平等党和国家领导人走进会场，全场响起热烈掌声。习近平等微笑着同身着民族服装的少数民族代表委员亲切握手、互致问候。\r\n\r\n　　“总书记好！”坐在习近平身旁的拉萨市城关区纳金乡塔玛村党总支第一书记格桑卓嘎代表激动地向习近平问好。习近平向她了解当地群众生产生活情况。格桑卓嘎告诉总书记，塔玛村过去是远近闻名的穷村，现如今，上学不付费、看病不出村、养老不犯愁、住房不比城里差，大家从心底里感到真是赶上了好时代。习近平听了十分高兴，请她转达对乡亲们的问候，祝大家日子越过越红火。买买提依布热依木·买买提明代表是新疆维吾尔自治区策勒县策勒乡巴西玉吉买村党支部书记、村委会主任。他向总书记汇报了当地发展经济、改善民生、保护生态、加强民族团结等方面的情况。习近平叮嘱他要切实做好民族团结工作，带领大家团结一心奔小康。\r\n\r\n　　李克强、张德江、俞正声、刘云山、王岐山、张高丽等也同少数民族代表委员亲切交谈，勉励大家围绕党和国家中心工作认真履行职责、积极献计献策，多办促改革、谋发展、惠民生的实事，团结各族人民为实现中华民族伟大复兴中国梦努力奋斗。\r\n\r\n　　茶话会由全国人大常委会副委员长向巴平措主持。中共中央政治局委员、中央统战部部长孙春兰讲话。她指出，党中央高度重视民族工作，作出了一系列支持民族地区发展的决策部署，深入人心、落地生根。我们要更加紧密地团结在以习近平同志为核心的党中央周围，始终坚持中国特色解决民族问题的正确道路，坚持和完善民族区域自治制度，坚持把维护民族团结和国家统一作为各民族的最高利益，大力实施兴边富民和脱贫攻坚行动，促进各民族交往交流交融，共同构筑中华民族命运共同体。各民族要像石榴籽那样紧紧抱在一起，在中华民族大家庭中共同团结奋斗、共同繁荣发展。\r\n\r\n　　茶话会上，文艺工作者表演了精彩的文艺节目。歌舞《跟党走上小康路》、《再唱山歌给党听》、《山歌好比春江水》、《花儿与少年》、《我们新疆好地方》、《母亲是中华》，舞蹈《丰收乐》，乐舞《一带一路彩云飞》，马头琴与长调《骏马颂》等节目，展现了我国民族艺术的独特魅力，表达了各族儿女团结奋斗实现中华民族伟大复兴中国梦的信心和决心。演员们精彩的演出，赢得全场阵阵掌声。\r\n\r\n　　中共中央政治局委员、中央书记处书记，全国人大常委会部分领导同志，国务委员，全国政协部分领导同志，中央军委委员，出席全国两会的五个自治区的其他代表、委员，各省区市主要负责同志，香港特别行政区、澳门特别行政区和台湾代表团负责人，有关方面负责人等约1100人出席茶话会。', '2017-03-12 10:14:08', '2017-03-12 10:14:08', '1', '20170217111105240', , '2017-03-12', '1');
