INSERT INTO `news_info` VALUES ('20170329100202958', '北京主政官员放话：房价要是再涨 我这儿还有招', '未知', '今天，北京市规划国土委发布了一则重磅通知：《北京城市总体规划（2016年—2030年）》草案已经编制完成，即日起对草案进行公告。\r\n\r\n值得注意的点在于，这一草案对于北京人口规模的规划——与此前京津冀一体化的要求一致，即确定北京常住人口规模2020年控制在2300万人以内。\r\n\r\n结合近期密集楼市调控、周小川表态等一系列新闻来看，则会读出更多的意味。\r\n\r\n人口\r\n\r\n岛妹曾经算过，2016年底，北京常住人口是2172.9万人。要达到2020年的目标，只剩127.1万人的增量空间，也就是说，平均每年仅允许增长31万余人。并且，2020以后，将长期稳定控制在2300万人左右。\r\n\r\n要知道，数据显示，仅2009年一年，北京市常住人口就增加了98万。\r\n\r\n此规划发布的背景也很耐人寻味：在楼市密集调控、10天9大招之后——有种没管住自己吃了一肚子美食的复杂饱胀感，吃多了，影响春天减肥大业；吃少了，口腹之欲不足又影响心情。虽然在以房控人和调控房价之间如何执两用中，将是继续困扰北京主政者的难题，但至少从眼前形势看，调控的确是在步步紧逼。\r\n\r\n真格\r\n\r\n3月26日是个特别的日子。\r\n\r\n当天上午，央行行长周小川在博鳌论坛分论坛上表示，在实施多年量化宽松货币政策之后，本轮政策周期已经接近尾声，即货币政策不再像过去那样宽松；\r\n\r\n当晚，北京市发布《关于进一步加强商业、办公类项目管理的公告》，全面叫停“商改住”——加上之前的严控首付比例、贷款利率、非京籍购房纳税标准、过道学区房、学位划分等，几乎断绝了所有炒房的可能，被冠以“史上最严”“冒头就打”等字眼。甚至有消息人士告诉岛妹，近日在采访主政官员时被告知，“房价要是再涨，我这儿还有招”；入夜，房企大佬万科公布2016年年报，表示对国家的楼市调控政策“感到欣慰”，已经对12个城市的13个项目计提了“跌价准备”，并且怀揣870亿现金时刻准备着抄底优质项目。\r\n\r\n不止如此。杭州和厦门同样祭出了“认房又认贷”的“房市核弹”，广州成都等地也密集调控……北京的严格调控并非孤例。其中信息量太大，简言之一句话：这次楼市调控是要动真格了。从以往历次的楼市调控来看，如果政府光是出台一些应急政策，短暂冷冻购房需求，很多楼市投资客完全没有怕的，最多眼下冷清一阵子，权当给自己放个假，等调控渐渐放松后，卷土重来，俨然又是一条兴风作浪的好汉。\r\n\r\n在这方面，近些年，北京房价每经一次调控，都会迎来新一轮报复性上涨，已经是最有说服力的佐证。\r\n\r\n这次的不同之处在哪儿？\r\n\r\n最大的利空可能就是货币政策。毕竟，这么些年的房价上涨，虽然不能完全归咎于宽松的货币政策，但不可否认其中千丝万缕的联系。央行不断放水，实际存款利率不断走低，“资产荒”导致大量资金流向楼市，影响楼市供需关系，从而推升房价。从一定程度上可以说，只要货币继续宽松，市场对于房价继续上涨的预期就难以改变。\r\n\r\n如今，高层明确表态，货币宽松周期结束，除了频频通过公开市场操作悄然收紧流动性，相关房贷也被纳入严格监管流程，楼市资金的大输血包将渐行渐远，可谓对炒房客的当头一击。', '2017-03-29 10:02:02', '2017-03-29 10:02:02', '1', '20170217111105240', , '2017-03-29', '0');
INSERT INTO `news_info` VALUES ('20170329100244464', '国足输伊朗 伊网民槽点怪:为啥中国女性能看球', '新浪', '德黑兰，阿扎迪球场，\r\n\r\n0：1！\r\n\r\n虽然拼尽全力，中国男足还是没能从“亚洲第一魔鬼主场”全身而退，\r\n\r\n刚有点苗头的出线希望，又变得渺茫。\r\n\r\n赛前，伊朗足协决定让球迷免费入场看球，\r\n\r\n希望十万波斯男人的呐喊，可以吓住国足。\r\n\r\n看看阿扎迪球场这阵势，密集恐惧症患者会吓哭吧……看看阿扎迪球场这阵势，密集恐惧症患者会吓哭吧……\r\n\r\n但国足的表现还是可圈可点的。\r\n\r\n毕竟和小组第一伊朗队，实力差距明显。\r\n\r\n依照惯例，环环（ID：huanqiu-com） 又请来了波斯语大拿，为大家搜集伊朗球迷神评论，“复盘”这场球。\r\n\r\n开赛前两小时，伊朗第一大电信运营商Hamrah Aval在自己的instagram主页上开展了比分竞猜，逾2500位网友留言，大部分留言的伊朗人都猜比分是2：1。\r\n\r\n伊朗法尔斯通\r\n\r\n伊朗法尔斯通讯社发了一张中国观众入场的照片，其中可以看到有戴头巾的中国女性↓\r\n\r\n（本场比赛中国观众女性戴头巾，衣着保守就被允许入场。）（本场比赛中国观众女性戴头巾，衣着保守就被允许入场。）', '2017-03-29 10:02:44', '2017-03-29 10:02:44', '0', '20170217111105240', , '2017-03-29', '0');
INSERT INTO `news_info` VALUES ('20170329100746336', '楼市新一轮调控来袭 福州杭州等地同日发布新政', '新浪', '中新网3月29日电 28日晚，福州、杭州及厦门相继推出房地产市场调控新政，引发舆论关注。其中，福州指出，3月29日起，非福州本市五城区户籍居民家庭不得通过补缴个人所得税或社会保险取得本市五城区购房资格。杭州则明确本市户籍成年单身（含离异）人士在限购区域内限购一套住房等措施。\r\n\r\n福州：取得不动产权证未满2年的不得上市交易\r\n\r\n28日晚，福州市人民政府办公厅发布《福州市人民政府办公厅关于进一步加强房地产市场调控的通知》（以下简称《通知》），并将于3月29日起实施。\r\n\r\n根据《通知》，3月29日起，非福州本市五城区户籍居民家庭不得通过补缴个人所得税或社会保险取得本市五城区购房资格；本市五城区户籍居民家庭在本市五城区已拥有一套住房，购买第二套住房商业性住房贷款首付比例不低于50%；本市五城区户籍居民家庭购买第二套住房，非本市五城区户籍居民家庭购买第一套住房，取得不动产权证未满2年的，不得上市交易，不得办理转让公证手续。\r\n\r\n《通知》指出，为贯彻落实中央“房子是用来住的，不是用来炒的”精神，进一步稳定市场预期，保障合理需求，打击投机炒房，保持房地产市场平稳健康发展，将采取包括加大公共租赁住房供给、加大住宅用地供应、严厉查处恶意哄抬房价等在内的八项措施。\r\n\r\n《通知》要求，要加大公共租赁住房供给。2017年内筹集投放一批公共租赁房源，同时规划建设一批公共租赁住房项目，用于解决不同层次群众住房需求；要加大住宅用地供应，2017年市区普通商品住宅用地供应量比2016年增加一倍以上。', '2017-03-29 10:07:46', '2017-03-29 10:07:46', '3', '20170217111105240', , '2017-03-29', '1');
INSERT INTO `news_info` VALUES ('20170329100827118', '孕妇产检HIV阳性未获告知 丈夫称整个家都毁了', '未知', '央广网宜宾3月28日消息（记者 白杰戈 刘涛）据中国之声《新闻晚高峰》报道，四川宜宾的一名孕妇去年7月在当地医院妇产科检查的时候发现梅毒抗体检测阳性，HIV（艾滋病毒）初筛阳性，但一直到今年2月孩子降生，夫妻俩才知道这个检测结果。宜宾市卫生计生委表示，首诊医生没有联系到夫妻俩，之后几次孕期检查的医生也没有核实情况，直接按正常孕产妇处理。目前这名新生的女婴被诊断为先天性梅毒、HIV暴露。\r\n\r\n王先生介绍，妻子曾女士去年7月在宜宾市妇幼保健院发现怀孕之后，按规定做了孕早期相关检查。宜宾市卫生计生委调阅记录发现，7月6日医院出具的检验结果显示：曾女士梅毒抗体检测阳性，HIV（艾滋病毒）初筛阳性。但是曾女士和王先生并不知道这个结果。\r\n\r\n王先生说，“我们又不懂医学，拿到手的报告都是正常的，不知道当时还有另外一部分报告没有拿到，他们没有上报市疾控，也没有跟我们讲，报告也没有拿给我们。”\r\n\r\n半年多之后，曾女士到宜宾市妇幼保健院实施剖腹产，术前检查才再次发现曾女士梅毒抗体阳性，HIV初筛阳性。\r\n\r\n王先生向记者讲述了当时的状况，“手术医生翻了一下所有的病历，发现没有这个检测报告，我们家属也找了很久没有找到这个单子，他说你这个病历单里怎么少了一个单子？我说所有的都在这里面，你们再仔细找一下好了。他们马上再做抽血检查，那是我们住进医院的第一天小孩还没生，第二天要剖腹产，等抽血的结果出来以后，小孩已经生下来了。”\r\n\r\n宜宾市卫生计生委发布的调查报告说，去年7月初的检查发现梅毒和HIV阳性之后，医院检验科根据危急报告制度反馈给首诊医生刘仁惠，要求曾女士返回做复检，刘医生拨打曾女士的预留电话，但无法联系到本人。曾女士的丈夫王先生否认了这一说法，认为“电话打不通”是他们的借口。', '2017-03-29 10:08:27', '2017-03-29 10:08:27', '1', '20170217111105240', , '2017-03-29', '1');
INSERT INTO `news_info` VALUES ('20170329100906286', '巴黎华人哀悼被射杀同胞 与警察冲突35人被逮捕', '新浪', '[环球时报综合报道]“今晚会有更多华人参加抗议活动！”——巴黎便衣警察26日晚在一次治安干预行动中枪杀一名华人男子，引起在法华人华侨的极大愤慨，28日事件继续发酵，当地华人在微信群里相约晚8点“采取行动”，据称一部分人会到警局前静坐，另一部分人将去中国游客常去的老佛爷、春天等百货公司前示威。巴黎警方至今没有给出令华人满意的说法，而涉事的巴黎19区警局在28日白天已增加大批警力及反恐特警，应对当晚可能再次发生的冲突。\r\n\r\n此事在旅法华人华侨圈里引起前所未有的反响。死者家属与一些亲友27日白天前往警局讨说法，一名女警官表示要调查后才能有结论。27日晚，大约有200名华人聚集在巴黎第19区警察局门口举行示威，在双方几轮言语冲突后，激动的华人示威者对警察投掷玻璃瓶、石块等，警察也用催泪瓦斯等进行回击，且调动大批警察防暴队到场镇压。法新社称一辆警车被燃烧物烧毁，3名警察被投掷物击中受伤。巴黎警察总局随后宣布，警方一共拘捕了35人，其中26人的罪名是“聚众实施暴力”，3人罪名是“对公共治安人员施加暴力以及用燃烧物焚毁警车”，还有6人罪名是“对警察投掷物品”。28日下午在警局前又有小规模华人示威。\r\n\r\n中国驻法大使馆迅速作出反应，27日出席各侨团联席会议了解情况，要求巴黎警察当局对此作出明确解释。中国外交部发言人华春莹28日在例行记者会上说，获悉此事后外交部高度重视，立即指示中国驻法国使馆启动应急机制，第一时间向法方提出交涉。中国驻法国使馆已派员前往看望慰问死者家属。\r\n\r\n26日华人被杀后，法国媒体一度报道很少。美国“twitchy”网站28日一早将这条新闻置于国际新闻的头条，文中写道：通常，我们不需要从中国的《人民日报》了解欧洲新闻。但关于在巴黎数百华人与警方发生暴力冲突的消息我们是在《人民日报》英文推特上发现的。文章称，法新社的推特“到目前为止”还没有提到这场骚乱，最新的两条推特是关于纽约“无畏女孩”雕塑及吃水果对于人类的好处。', '2017-03-29 10:09:06', '2017-03-29 10:09:06', '1', '20170217142921082', , '2017-03-29', '1');
INSERT INTO `news_info` VALUES ('20170329100946969', '留华韩国人:改变若隐若现 超市保安比顾客还多', '未知', '在中国生活了20多年的韩国人朴济英，如今可以当之无愧地说，“我是老望京了”。在这块被称为“中国韩国城”的北京最大韩国人聚居区里，韩国人人数最多时超过5万。\r\n\r\n望京有闪着中韩字体的彩色霓虹灯箱、韩国企业云集的大厦、最正宗的韩餐馆。在街上，人们已经很难从外表分辨路人是中国人还是韩国人。\r\n\r\n超市里，六神花露水和韩国空气清新剂整齐地码放在一个货架上；芝麻叶和香菜这两种基本不会在对方菜谱上出现的香料，也乖乖地躺在同一个冷藏柜里。\r\n\r\n中心广场上孩子在嬉闹，年轻的韩国母亲用不熟练的中文，和中国大爷大妈聊着天。\r\n\r\n如今，这种平静正在被打破，一些改变若隐若现。\r\n\r\n在乐天超市望京店，一个工作日的午后，门前停着警车，超市里安保人员多了一倍，清空的货柜上少有韩国品牌的食品，戴着“安全员”袖章的员工比顾客还多。\r\n\r\n两周前，一位刚毕业的韩国留学生，本打算在中国找工作，却临时改变计划，改签了第二天的航班，一刻不敢停留似地飞回了自己的国度。\r\n\r\n这一切，都让朴济英担忧：“中韩关系就像一壶水，烧了半个小时才能热，碰到凉水又迅速凉下来了，不知何时才能再热起来？”\r\n\r\n平静，不平静\r\n\r\n3月中旬开始，朴济英发觉自己“享受”了一种“特殊待遇”。\r\n\r\n他在山东某学校兼任外籍教授，每周往返于北京和山东。当他上完课乘坐高铁返回北京时，收到问候短信“你安全离开了吗？”他突然意识到，自己变成了“特殊保护的重点”。\r\n\r\n', '2017-03-29 10:09:46', '2017-03-29 10:09:46', '2', '20170217142921082', , '2017-03-29', '1');
INSERT INTO `news_info` VALUES ('20170329101018278', '菲媒:3名中国人在菲律宾遭绑架 当地警方正追查', '未知', '【环球网报道 记者 赵衍龙】《菲律宾商报》3月29日报道称，3名中国人于前天在菲律宾岷里拉市马拉地区遭绑架。\r\n\r\n报道称，23岁的林小森、29岁的严文龙和35岁的林龙虎(皆音)于前天大约凌晨零点30分左右在罗哈斯大道的一家餐厅用完餐后，正要登上林小森车牌号为WIS-503的路虎揽胜车里时，3名蒙面男子突然出现并把他们强行掳走。\r\n\r\n受害者的朋友，也是本案的目击者是表示，嫌犯强行控制了他们的车，并带着该3人开走该辆车，他尝试跟着嫌犯们，但并没有成功。\r\n\r\n菲律宾警方称，可能作为支援的另2辆车是一灰一红，在上述汽车被开走后立刻跟着。可能至少7人涉案。警方现正在追查该案件，以找出遭绑架的受害者。\r\n', '2017-03-29 10:10:18', '2017-03-29 10:10:18', '3', '20170217142921082', , '2017-03-29', '1');
